INSERT INTO `roomexit` VALUES (11237,4,'','As your recover from your fall you look around.  The walls are made of a\nsmooth red metal and are probably unclimbable.  The walls suddenly become\nunimportant as you become more aware of your surroundings.  You sense that\nthis is the home of something evil and that you might not be alone.  The\nhair on the back of your neck begins to rise.\nBlood and filth flow into a grate on the floor.\n',0,0,-1,-1,0,11236);
