INSERT INTO `roomexit` VALUES (11374,2,'crack granite wall','This room is filled with debris due to involuntary remodeling by a natural\ndisaster.  It is roughly polygon-shaped with walls jutting into the room at\nright angles.  The walls that are standing are flat sheets of rock,\nreinforced with stout wooden posts.  Others lie broken on the floor amid\nthe rubble.  The way south is blocked by a stout granite wall, but it seems\nto be cracking in places.\n',1,5,-1,3,0,11352);
