INSERT INTO `roomexit` VALUES (14366,7,'','  You are in a crawlspace under the meeting hall.  A first glance, this\nplace doesn\'t appear to have been visited in a long time, maybe since the\nhall was built.  Cobwebs hang from the ceiling, which is only about three\nand a half feet tall.  The walls are of stone block construction and\nappear quite sturdy.  The floor is made of dirt, and is covered with a\nlayer of dust.  A flimsy wooden ladder leads up to the trapdoor in the\nceiling, and the room continues to the northwest.\n',0,0,-1,-1,0,14367);
INSERT INTO `roomexit` VALUES (14367,1,'','  You are in a crawlspace under the meeting hall.  A first glance, this\nplace doesn\'t appear to have been visited in along, time, maybe since the\nhall was built.  Cobwebs hang from the ceiling, which is only about three\nand a half feet tall.  The walls are of stone block construction and\nappear quite sturdy.  The floor is made of dirt, and is covered with a\nlayer of dust.  The room continues to the southeast, and a hole has been\nknocked in the wall to the east.\n',0,0,-1,-1,0,14368);
