INSERT INTO `roomexit` VALUES (80,1,'','You find yourself in the ante room to the immortal conference area,\nwhere you\'re arrival won\'t disturb any conferences in progress.\nThe main conference room lies to the east.\n',0,0,-1,-1,0,81);
INSERT INTO `roomexit` VALUES (81,0,'','You are in the immortal conference room, a most unusual room thats\nactual size seems more determined by the number of people in the\nroom than by its physical dimensions.  The center of the room is\ndominated by a large conference table, covered with empty Mountain\nDew cans and used coffee cups.  A number of chairs line the walls,\nsomehow there always seems to an extra when you need one.  The\nante room out of the complex is to the west, a small kitchenette is\nthe east, and sub-committee rooms are to the north and south.\n',0,0,-1,-1,0,82);
